import React, { Component } from "react";

class LogInButtons extends Component {
  constructor() {
    super();
    this.state = {
      show: true
    }
  }

  render() {
    return (
      <>
        <button>Log In</button> | <button>Log Out</button>
      </>
    );
  }
}

export default LogInButtons;

